;==========
;==========
; Language
;==========
;==========

;========
; Syntax
;========
(adt/defadt exp
  (NUM v)			;numbers
  (VAR v)			;variables
  (ITE e1 e2 e3)	;conditional expressions
  (BEX bex)			;binary expressions
  (UEX uex)			;unary expressions
  )

(adt/defadt bex
  (ABEX abex) 		;arithmetic expressions
  (BBEX bbex) 		;boolean expressions
  )

(adt/defadt abex
  (PLUS e1 e2)		;plus
  (MINUS e1 e2)		;minus
  (MULT e1 e2)		;multiplication
  (DIV e1 e2)		;division
  )

(adt/defadt bbex
  (LT e1 e2)		;less than
  (GT e1 e2)		;greater than
  (LTE e1 e2)		;less than or equal to
  (GTE e1 e2)		;greater than or equal to
  (EQ e1 e2)		;equal to
  (NEQ e1 e2)		;not equal to
  )

(adt/defadt uex
  (NOT e)			;logical negation
  )

;=============
; Interpreter
;=============
	;Ref: http://stackoverflow.com/questions/10313657/is-it-possible-to-overload-clojure-multi-methods-on-arity
	;Ref(about defmulti & num-of-arguments problem):
		; http://stackoverflow.com/questions/24246364/defmethod-multi-clojure-lang-arityexception-wrong-number-of-args-2-passed
		; https://groups.google.com/forum/#!topic/clojure/XcsouTQeLxw

(defmulti eval-exp
  "Evaluate expressions."
  (fn [e & xs] (adt/adt-type e)))
(defmethod eval-exp NUM [e x]
  (e :v))
(defmethod eval-exp VAR [e x]
  x)
(defmethod eval-exp ITE [e x]
  (if (eval-exp (e :e1) x) 
    (eval-exp (e :e2) x)
    (eval-exp (e :e3) x)))
(defmethod eval-exp BEX [e x]
  (eval-bex (e :bex) x))
(defmethod eval-exp UEX [e x]
  (eval-uex (e :uex) x))
(defmethod eval-exp :default [_ _]
  (throw (IllegalArgumentException.
           "eval-exp: wrong arguments")))

(defmulti eval-bex
  "Evaluate binary expressions."
  (fn [e & xs] (adt/adt-type e)))
(defmethod eval-bex ABEX [e x]
  (eval-abex (e :abex) x))
(defmethod eval-bex BBEX [e x]
  (eval-bbex (e :bbex) x))
(defmethod eval-bex :default [_ _]
  (throw (IllegalArgumentException.
           "eval-bex: wrong arguments")))

(defmulti eval-abex
  "Evaluate arithmetic binary expressions."
  (fn [e & xs] (adt/adt-type e)))
(defmethod eval-abex PLUS [e x]
  (+ (eval-exp (e :e1) x)
     (eval-exp (e :e2) x)))
(defmethod eval-abex MINUS [e x]
  (- (eval-exp (e :e1) x)
     (eval-exp (e :e2) x)))
(defmethod eval-abex MULT [e x]
  (* (eval-exp (e :e1) x)
     (eval-exp (e :e2) x)))
(defmethod eval-abex DIV [e x]
  (/ (eval-exp (e :e1) x)
     (eval-exp (e :e2) x)))
(defmethod eval-abex :default [_ _]
  (throw (IllegalArgumentException.
           "eval-abex: wrong arguments")))

(defmulti eval-bbex 
  "Evaluate boolean binary expressions"
  (fn [e & xs] (adt/adt-type e)))
(defmethod eval-bbex LT [e x]
  (< (eval-exp (e :e1) x)
     (eval-exp (e :e2) x)))
(defmethod eval-bbex GT [e x]
  (> (eval-exp (e :e1) x)
     (eval-exp (e :e2) x)))
(defmethod eval-bbex LTE [e x]
  (<=
    (eval-exp (e :e1) x)
    (eval-exp (e :e2) x)))
(defmethod eval-bbex GTE [e x]
  (>=
    (eval-exp (e :e1) x)
    (eval-exp (e :e2) x)))
(defmethod eval-bbex EQ [e x]
  (=
    (eval-exp (e :e1) x)
    (eval-exp (e :e2) x)))
(defmethod eval-bbex NEQ [e x]
  (not=
    (eval-exp (e :e1) x)
    (eval-exp (e :e2) x)))
(defmethod eval-bbex :default [_ _]
  (throw (IllegalArgumentException.
           "eval-bbex: wrong arguments")))

(defmulti eval-uex
  "Evaluate unary expressions"
  (fn [e & xs] (adt/adt-type e)))
(defmethod eval-uex NOT [e x]
  (not
    (eval-exp (e :e) x)))
(defmethod eval-uex :default [_ _]
  (throw (IllegalArgumentException.
           "eval-uex: wrong arguments")))

;==========
; Tostring
;==========
(defmulti str-exp
  "Return string forms of expressions."
  adt/adt-type)
(defmethod str-exp NUM [e]
  (str "NUM(" (e :v) ")"))
(defmethod str-exp VAR [e]
  (str "VAR(" (e :v) ")"))
(defmethod str-exp ITE [e]
  (str "IF (" (str-exp (e :e1))
       ") THEN (" (str-exp (e :e2))
       ") ELSE (" (str-exp (e :e3)) ")"))
(defmethod str-exp BEX [e]
  (str-bex (e :bex)))
(defmethod str-exp UEX [e]
  (str-uex (e :uex)))
(defmethod str-exp :default [_]
  (throw (IllegalArgumentException.
           "str-exp: wrong adt-type")))

(defmulti str-bex
  "Return string forms binary expressions."
  adt/adt-type)
(defmethod str-bex ABEX [e]
  (str-abex (e :abex)))
(defmethod str-bex BBEX [e]
  (str-bbex (e :bbex)))
(defmethod str-bex :default [_]
  (throw (IllegalArgumentException.
           "str-bex: wrong adt-type")))

(defmulti str-abex
  "Return string forms of arithmetic binary expressions."
  adt/adt-type)
(defmethod str-abex PLUS [e]
  (str "PLUS(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-abex MINUS [e]
  (str "MINUS(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-abex MULT [e]
  (str "MULT(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-abex DIV [e]
  (str "DIV(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-abex :default [_]
  (throw (IllegalArgumentException.
           "str-abex: wrong adt-type")))

(defmulti str-bbex
  "Return string forms of boolean binary expressions."
  adt/adt-type)
(defmethod str-bbex LT [e]
  (str "LT(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-bbex GT [e]
  (str "GT(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-bbex LTE [e]
  (str "LTE(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-bbex GTE [e]
  (str "GTE(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-bbex EQ [e]
  (str "EQ(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-bbex NEQ [e]
  (str "NEQ(" (str-exp (e :e1)) "," (str-exp (e :e2)) ")"))
(defmethod str-bbex :default [_]
  (throw (IllegalArgumentException.
           "str-bbex: wrong adt-type")))

(defmulti str-uex
  "Return string forms of unary expressions."
  adt/adt-type)
(defmethod str-uex NOT [e]
  (str "NOT(" (str-exp (e :e)) ")"))
(defmethod str-uex :default [_]
  (throw (IllegalArgumentException.
           "str-uex: wrong adt-type")))

